import React from "react";
import styles from "./BusinessList.module.css";

import Business from "./../Business/Business";

const BusinessList = ({ businesses }) => {
  return (
      <div className={styles.BusinessList}>
          {/* Check if businesses is defined */}
          {businesses && businesses.length === 0 ? (
              <h2 className={styles.initialText}>
                  You may need to visit this{" "}
                  <a
                      href="https://cors-anywhere.herokuapp.com/corsdemo"
                      target="_blank"
                      rel="noopener noreferrer"
                  >
                      link
                  </a>{" "}
                  first and request temporary access in order to display search results
              </h2>
          ) : (
              // If businesses is defined and not empty, map over it
              businesses &&
              businesses.map((business) => {
                  return <Business business={business} key={business.name} />;
              })
          )}
      </div>
  );
};

export default BusinessList;
